import React, { Component } from "react";
import { withStyles } from "@material-ui/core";
import PropTypes from "prop-types";
import img from "../image/lake.jpg";
import img2 from "../image/mount.jpg";
import img3 from "../image/camera.jpg";
const styles = {
  ima: {
    width: "100%",
    height: "900px"
  },
  home: {
    marginTop: "-20%"
  }
};
class Home extends Component {
  render() {
    const { classes } = this.props;
    return (
      <div>
        <div>
          <img className={classes.ima} src={img2} alt="img2" />
          <button className="home button1">
            {" "}
            <h3>Kroz objektiv</h3>
          </button>{" "}
        </div>
        <img className={classes.ima} src={img3} alt="img3" />
        <img className={classes.ima} src={img} alt="img" />
        <div className="footer">
          <p>Sve slike su preuzete s https://unsplash.com</p>
        </div>
      </div>
    );
  }
}

Home.propTypes = {
  classes: PropTypes.object.isRequired
};
export default withStyles(styles)(Home);
